INSERT INTO `about_us` (`id`, `title`, `image_1`, `image_2`, `description`, `created_on`) VALUES
(1, 'Who are we?', 'images/fdd43691c764721eaf6321068a0e6301.jpg', 'images/24863418-hands-holding-green-heart-shaped-tree-tree-arranged-in-a-heart-shape-love-nature-save-the-world-heal-Stock-Photo.jpg', '<p><strong>Fooduction is a team of eveyday individuals wanting to bring a change. Our team consists ofÂ enthusiastic, fun and innovative group of individuals whoÂ believeÂ that we can change the world together, one meal at a time.</strong></p>\r\n\r\n<p><strong>Feel free to drop in to our officeÂ or write to us. Our contact details are on the website at www.fooduction.com.au</strong></p>\r\n', '2016-12-06 05:39:50'),
(2, 'Objective', 'images/502155430_ca46611dde.jpg', 'images/Screen Shot 2017-01-20 at 12.32.39 PM (002).png', '<p><strong>Our objective at Fooduction is to deal with all food items in the best manner possible with the environment at heart!</strong></p>\r\n', '2016-12-06 05:39:50'),
(3, 'What we are doing?', 'images/BRANDING BIBLE (4).jpg', 'images/Screen Shot 2017-01-20 at 12.32.27 PM (002).png', '<p><strong>Fooduction is a social enterprise working&nbsp;towards revolutionizing food waste industry. We are set out to change people&#39;s outlook towards&nbsp;food. We believe, freshly made, good quality food is as precious as any other natural resources like fuel, water or even gems. Do we throw fuel away? Diamonds?</strong></p>\r\n\r\n<p><strong>The aim here at Fooduction is to provide a platform where businesses can sell delicious and healthy food well before they perish&nbsp;at great discounts to minimise their losses. This&nbsp;gives consumers&nbsp;an opportunity to recscue these food items while making signinficant savings. This&nbsp;benefits the community&nbsp;while working towards the greater good of minimising food waste and saving the environment.</strong></p>\r\n', '2016-12-06 05:41:26');
