(49, 'Rashmi', 'rashmid911@gmail.com', 'I am hungryyyy!!!!!', 1, 'Order food now', 470, '1489733952'),
(53, 'Karan', 'karan_kapasi@hotmail.com', 'Hi I order some food through your app but when I got to the restaurant to pick it up the items were no longer available.\nI am very frustrated and would like this resolved ASAP.\nCould you plz refund my money straight away. I would also like to know why did the order get proceeded if the items were not available and if they were available at the time of order then why was it sold to someone else \nLook forward to your reply.', 1, 'Hi Karan,\r\n\r\nFirstly, please accept our sincere apology for the issue with your order. We are sorry that the items were not available as per your order. We have been in touch with the owner since to discuss the situation and the reason for this was because the owner had missed updating the items from last yesterday. Unfortunately, it is not possible for us to know what is available at the individual business on the day so we rely on the business owners to update items as they have available. However, let me assure you that we encourage our businesses to always ensure that they provide you a replacement meal if your order item is not available since our idea is to reduce food waste so you will be given another item of your choice which would have ended up in thrash. We will appreciate any suggestions that you may have and please find below the receipt for your refund which is now processed.\r\n\r\nThanks for joining the fight against food waste, we appreciate your support.\r\n\r\nKind Regards,\r\n\r\nRoopika\r\n\r\nTeam Fooduction ', 448, '1494674857'),
(56, 'Jesd', 'ibizzcom1@gmail.com', 'Helll can we check the address n location before we order???', 0, '', 882, '1497000931'),
(59, 'Linda Cheng', 'doremilin@yahoo.com', 'Hi, I would like to request for a refund on the salad I purchased yesterday from Milktooth please.', 0, '', 480, '1501309488'),
(82, 'Frances', 'frances.barns@gmail.com', 'How can you tell the location of the vendor?', 1, 'Hi Frances,\r\nThe location and the pick up hours are in the vendor comment section of the dish. If you have not updated the app recently, we would request you to update since we added a couple of extra features and we are also going to be putting map to make it easier for you to know :) Let us know if you would like to know where a particular vendor is.\r\nKind Regards,\r\nRoopika\r\nTeam Fooduction', 533, '1504503309'),
(84, 'Marc', 'beachbumlife@live.com', 'I would like to delete my account', 1, 'Hi Marc, no worries. We will delete it. Would you like to share feedback for improvements?', 1265, '1511343393'),
