INSERT INTO `recipes` (`id`, `name`, `description`, `category`, `cooking_hr`, `cooking_min`, `preparation_hr`, `preparation_min`, `serving_to`, `difficulty`, `created_on`) VALUES
(1, 'Corn fritters with jalapeno butter and heirloom tomato salad', 'For fritters with a sting in the tail, try this chilli-lovers'' recipe featuring jalapenos. They''re great with mashed avocado, bacon and a poached egg for breakfast. If you love heat, use fresh jalapenos for the butter, otherwise make it with pickled jalap', 'Lunch', '0', '30', '0', '0', 4, 'Easy', '2018-02-20 10:50:18'),
(2, 'Yummy scrummy carrot cake recipe', 'Delight friends with an afternoon tea that includes this dairy-free carrot cake. You can bake the cake, freeze it and just drizzle over the icing on the day', 'Dessert', '0', '0', '1', '30', 15, 'Easy', '2018-02-20 13:07:20'),
(3, 'Delight friends with an afternoon tea that includes this dairy-free carrot cake. ', 'Perfect for an afternoon setting. Great to have it with tea or coffee. Lemon cake is super easy to bake even if you have no experience. You can try this if you want to just get started with baking.', 'Dessert', '', '45', '', '15', 4, 'Easy', '2018-02-20 13:13:10'),
(4, 'Banana and spinach pancakes', 'Delicious, sumptous and healthy are the words that come to mind when we look at this recipe. It will make you fall in love with breakfast all over again.', 'Breakfast', '', '25', '', '15', 15, 'Medium', '2018-02-20 13:14:50'),
(6, 'Broccoli, spinach and apple muffins', 'Muffins don''t have to be unhealthy now. Taste meets health now! Try these not so sweet but delicious and healthy muffins. Good for breakfast or with afternoon tea.', 'Breakfast', '', '30', '', '30', 12, 'Medium', '2018-02-20 13:18:52'),
(7, 'Thai Pumpkin Coconut Soup Recipe', 'In Thailand, pumpkin and coconut milk are commonly paired up to make a variety of both savory and sweet entrees. In this recipe, the two come together beautifully in a lightly-curried soup that tastes as delicious as those you may have tried at your favor', 'Dinner', '', '10', '', '15', 3, 'Easy', '2018-02-20 13:22:02'),
(8, 'Bacon hash brown rollups', 'These delicious Bacon Hash Brown Rollups are stored in your freezer, then reheated in the microwave when you want to eat them. They''re perfect and easy to make for breakfast on the run, and are especially good on busy school mornings.\r\n\r\nYou can double or', 'Lunch, Dinner', '', '15', '', '20', 16, 'Easy', '2018-02-20 13:44:48'),
(9, 'Baba ganoush', 'This dip is very easy to make and a very popular one. It goes really well with your lebanese bread selection. The thickness and texture reminds you of hummus.', 'Dip', '', '35', '', '10', 6, 'Easy', '2018-02-20 13:46:34'),
