INSERT INTO `static_pages` (`id`, `title`, `description`, `created_on`) VALUES
(1, 'Term & Conditions', '<p><strong>FOODUCTION PTY LTD MARKETPLACE TERMS AND CONDITIONS </strong></p>\r\n\r\n<p><strong>Confidential </strong>Page 1 of 13</p>\r\n\r\n<p><strong>FOODUCTION PTY LTD &ndash; MARKETPLACE TERMS AND CONDITIONS </strong></p>\r\n\r\n<p>Fooduction Pty Ltd (ABN 60 615 234 725) (referred to as <strong>Fooduction</strong>) provides an introductory service, searchable directory and payment platform between businesses (<strong>Businesses</strong>) who seek to sell food items and/ or food dishes (collectively, the <strong>Services</strong>), and customers (<strong>Customers</strong>) who would like to buy these items and dishes. The Services are available on the Fooduction mobile application (<strong>App</strong>) and on the Fooduction website: fooduction.com.au (<strong>Site</strong>).</p>\r\n\r\n<p>1. <strong>Acceptance of Terms </strong></p>\r\n\r\n<p>(a) These Marketplace Terms and Conditions (<strong>Terms</strong>) form a binding legal agreement between Fooduction, its directors, officers, employees, successors and assignees, and each person, organization or entity using the App, Site and Services (referred to as <strong>User</strong>). By using the App, Site and Services, each User agrees to comply with and be legally bound by these Terms. Please read the Terms carefully. If there are any questions, the User is encouraged to contact Fooduction using the contact details at the end of these Terms.</p>\r\n\r\n<p>b) The User&rsquo;s use of the App, Site and the Services indicates that:</p>\r\n\r\n<p>(i) the User has had sufficient opportunity to access the Terms and contact Fooduction;</p>\r\n\r\n<p>(ii) The User has read, accepted and will comply with the Terms;</p>\r\n\r\n<p>(iii) The User has legal capacity to enter into a contract for sale; and</p>\r\n\r\n<p>(iv) The User is 18 years or older, or if younger than 18 years, the User has the approval of its parent or guardian.&nbsp;</p>\r\n\r\n<p>If this is not correct, or if the User does not agree to these Terms, the User is not permitted to use the Services.</p>\r\n\r\n<p>(c) These Terms may be amended from time to time, without prior notice. Use of our Services following any such amendments will be deemed to be confirmation that the User accepts those amendments. Fooduction recommends that each User check the current Terms, before continuing use of the Services. Fooduction&rsquo;s agents, employees and third parties do not have authority to change the Terms.</p>\r\n\r\n<p>(d) These Terms supplement and incorporate the Fooduction Website Terms of Use and Privacy Policy posted on the Site. Fooduction&rsquo;s Privacy Policy sets out how Fooduction collects, uses and protects the personal information of its Users. Fooduction&rsquo;s Website Terms of Use govern your use of the Site. These documents are available on the Site.</p>\r\n\r\n<p>(e) Each User also acknowledges that use of the Services may be subject to third party terms including:</p>\r\n\r\n<p>(i) The Android Terms of Service including, without limitation, the User Agreement;</p>\r\n\r\n<p>(ii) The iOS Terms and Conditions including, without limitation, the User Agreement;</p>\r\n\r\n<p>(iii) The POLi Terms and Conditions including, without limitations, the User Agreement; and</p>\r\n\r\n<p>(iv) the PayPal Terms of Service including, without limitation, the User Agreement.</p>\r\n\r\n<p><strong>2. Introductory Service Only </strong></p>\r\n\r\n<p>(a) The App, Site and the Services provide</p>\r\n\r\n<p>(i) A payment platform;</p>\r\n\r\n<p>(ii) A searchable directory where Customers may search for Businesses; and</p>\r\n\r\n<p>(iii) An online introductory platform between Businesses and Customers;</p>\r\n\r\n<p>through which (i) Businesses will be able to create a listing (<strong>Listing</strong>) advertising the sale of leftover food dishes and food items (<strong>Food Products</strong>) and (ii) Customers will be able to search for Businesses, view Listings and make orders for Food Products (<strong>Order</strong>).</p>\r\n\r\n<p>(b) A Customer can view Listings and make Orders through the App and Site. Once the Order is made, Fooduction notifies the Business of the Order. The App then provides a payment platform with Fooduction acting as a limited payment collection agent. When a Customer orders a Food Product, they accept any terms and conditions set out in the relevant Listing.</p>\r\n\r\n<p>(c) Each User must create a profile as per information requested on the App (<strong>Profile</strong>).</p>\r\n\r\n<p>(d) Customers can view the Profiles of Businesses and contact Businesses via their provided contact details to enquire about a Food Product Order they have made via the App.</p>\r\n\r\n<p><strong>FOODUCTION PTY LTD MARKETPLACE TERMS AND CONDITIONS Confidential </strong>Page 2 of 13</p>\r\n\r\n<p>(e) Each User understands and agrees that the App is an online introductory platform only, and that Fooduction&rsquo;s responsibilities are limited to facilitating the availability of the App and the Services.</p>\r\n\r\n<p>(f) Fooduction is not a party to any agreement entered into between a Business and a Customer. Fooduction is not a referrer or booking agent, and provides no such related services. Fooduction has no control over the conduct of Businesses, Customers and any other users of the App and the Services. Fooduction disclaims all liability in this regard, as set out in these Terms.</p>\r\n\r\n<p>(g) Any arrangement between a Business and a Customer is solely between the Business and Customer. It is strictly and expressly not part of the User&rsquo;s agreement with Fooduction.</p>\r\n\r\n<p><strong>3. Online Registration </strong></p>\r\n\r\n<p>(a) A User must register on the App and Site and create an account (<strong>Account</strong>) in order to browse and view Listings and Profiles and access the Services and features of the App and Site, including making a Listing, creating a Profile or purchasing a Food Product.</p>\r\n\r\n<p>(b) In order for a User to be registered as a Business, it must:</p>\r\n\r\n<p>(i) Submit a request to Fooduction (<strong>Request</strong>) for approval as a Business with any and all relevant information as required by Fooduction;</p>\r\n\r\n<p>(ii) The Request must be reviewed and approved by Fooduction, which reserves the right to reject any Request at its discretion.</p>\r\n\r\n<p>(c) Any User may register to be a Customer.</p>\r\n\r\n<p>(d) Each User may only have one (1) Account on the App and Site. Businesses may only have one Profile on the App.</p>\r\n\r\n<p>(e) Basic information is required when registering for an Account on the App. Each User is required to provide certain information including name, email address, and location and select a username and password.</p>\r\n\r\n<p>(f) Each User agrees to provide accurate, current and complete information during the registration process and to update such information to keep it accurate, current and complete. Fooduction reserves the right to suspend or terminate any User&rsquo;s Account and his/her access to the App, Site and Services if any information provided to Fooduction proves to be inaccurate, not current or incomplete.</p>\r\n\r\n<p>(g) It is the User&rsquo;s responsibility to keep its Account details, username and password confidential. The User is liable for all activity on its Account, including purchases made using its account details. The User agrees that it will not disclose its password to any third party and that it will take sole responsibility for any activities or actions under its Account, whether or not it has authorised such activities or actions.</p>\r\n\r\n<p>(h) The User will immediately notify Fooduction of any unauthorised use of its Account.</p>\r\n\r\n<p><strong>4. Users and User Profiles </strong></p>\r\n\r\n<p>(a) Users that have created an Account are permitted to create Profiles. The User&rsquo;s Profile for its use of the App is created from the personal information it provides to Fooduction.</p>\r\n\r\n<p>(b) Each User acknowledges and agrees that it is responsible for its own Profile.</p>\r\n\r\n<p>(c) Users can access the App to communicate with other Users and obtain or provide Food Products.</p>\r\n\r\n<p>(d) If a Customer contacts a Business and requests Food Products, any agreement entered into is between the Customer and Business. Fooduction is not a party to the agreement.</p>\r\n\r\n<p>(e) Each User acknowledges and agrees that any communications entered into with another User is at his or her own risk. Fooduction does not provide a User with and cannot guarantee that other Users have genuine intentions.</p>\r\n\r\n<p>(f) Each User should report to Fooduction, any activities or requests of Users which are, or which the User reasonably believes to be:</p>\r\n\r\n<p>(i) Suspicious;</p>\r\n\r\n<p>(ii) Inconsistent;</p>\r\n\r\n<p>(iii) Illegal; or</p>\r\n\r\n<p>(iv) Likely to have a negative effect on the reputation of Fooduction, the App, Services and/or a User.</p>\r\n\r\n<p><strong>FOODUCTION PTY LTD MARKETPLACE TERMS AND CONDITIONS Confidential </strong>Page 3 of 13</p>\r\n\r\n<p>(g) Each User acknowledges and agrees that while the App allows Users to communicate with each other, Users are not permitted to share the contact information of other Users.</p>\r\n\r\n<p>(h) For the avoidance of doubt, Fooduction assumes no responsibility for a User&rsquo;s compliance with any applicable laws, rules and regulations.</p>\r\n\r\n<p>(i) Each User represents and warrants that any content that it provides and Profile and Listing that it posts:</p>\r\n\r\n<p>(i) Will not breach any agreements it has entered into with any third parties;</p>\r\n\r\n<p>(ii) Will be in compliance with all applicable laws, tax requirements, and rules and regulations that may apply to any User in its local area and country; and</p>\r\n\r\n<p>(iii) Will not conflict with the rights of third parties.</p>\r\n\r\n<p>(j) Fooduction reserves the right, at any time and without prior notice, to remove or disable access to any Account and/or Profile and/or Listing for any reason, including Accounts and/or Profiles and/or Listings that Fooduction, at its sole discretion, considers to be objectionable for any reason, in violation of these Terms or otherwise harmful to the App or Services.</p>\r\n\r\n<p><strong>5. Obligations for Businesses </strong></p>\r\n\r\n<p>(a) A Business must set out all relevant information in a Listing such as the purchase price of the Food Product, description of the Food Product including ingredients, cuisine, allergy and health warnings, image of the Food Product and any other terms and conditions applicable to the sale of a Food Product. All Listings are subject to approval by Fooduction prior to publication, whose consent will not be unreasonably withheld.</p>\r\n\r\n<p>(b) Each Business represents and warrants that with regards to its Food Products, it will adhere to the following obligations:</p>\r\n\r\n<p>(i) All Listings are factually accurate and contain all necessary allergen and dietary requirement information;</p>\r\n\r\n<p>(ii) Listings cannot include Food Products that are past the expiry date or have less than 24 hours until expiry;</p>\r\n\r\n<p>(iii) Food Products that consist of unpackaged food will be of edible quality and is uncontaminated;</p>\r\n\r\n<p>(iv) It is responsible for any illness or harm that a Customer experiences as a result of ordering and purchasing the Business&rsquo;s Food Products, and subsequently indemnifies Fooduction of any liability in this regard; and</p>\r\n\r\n<p>(v) It will post at least 2 Listings per week on an ongoing basis to continue as an active member of the Services, and failure to do so may result in termination of the Business&rsquo;s Account in accordance with Clause 24(c).</p>\r\n\r\n<p>(c) Each Business further represents and warrants that with regard to its Food Products, that it has complied with and will continue to comply with:</p>\r\n\r\n<p>(i) All relevant State legislation and ancillary regulations in respect of food preparation, health and safety, including but not limited to the following:</p>\r\n\r\n<ul>\r\n	<li><em>Food Act 2008 (WA) </em>and the <em>Food Regulations 2009 (WA)</em>;</li>\r\n	<li><em>Food Act 2003 (NSW) </em>and the <em>Food Regulation 2015 (NSW) </em></li>\r\n	<li><em>Food Act 2006 (QLD), </em>the <em>Food Regulation 2006 (QLD), </em>the <em>Food Production (Safety) Act 2000 (QLD) </em>and the <em>Food Production (Safety) Regulation 2014 (QLD)</em>;</li>\r\n	<li><em>Food Act 1984 (VIC); </em></li>\r\n	<li><em>Food Act 2001 (SA) </em>and the <em>Food Regulations 2002 (SA) </em></li>\r\n	<li><em>Food Act (NT) </em></li>\r\n	<li><em>Food Act 2003 (TAS); </em></li>\r\n</ul>\r\n\r\n<p>as may be amended from time to time;</p>\r\n\r\n<p>(ii) Its obligations under the <em>Australian Consumer Law </em>in Schedule 2 of the <em>Competition and Consumer Act 2010 (Cth); </em>and</p>\r\n\r\n<p>(iii) its obligations and industry standards under the <em>Australia New Zealand Food Standards Code 2003 (Cth). </em></p>\r\n\r\n<p><strong>6. Ratings and Reviews </strong></p>\r\n\r\n<p><strong>FOODUCTION PTY LTD MARKETPLACE TERMS AND CONDITIONS Confidential </strong>Page 4 of 13</p>\r\n\r\n<p>(a) Customers may rate a Business&rsquo;s Profile (<strong>Rating</strong>), which determines the popularity of individual Profiles. Customers may also provide feedback to Businesses regarding Food Products purchased by that Customer or direct feedback about the Business (<strong>Review</strong>).</p>\r\n\r\n<p>(b) Ratings and Reviews of a Customer can be viewed by any User. Ratings and Reviews will remain viewable until the relevant Business&rsquo;s Account, Profile and Listings are removed or terminated.</p>\r\n\r\n<p>(c) Customers must provide true, fair and accurate information in their Review and any opinion in the Review must be an honestly held opinion based on fact and personal experience.</p>\r\n\r\n<p>(d) If, in Fooduction&rsquo;s reasonable assessment, the Review is untrue, unfair, inaccurate, offensive or inappropriate, Fooduction may delete the Review or ban the Customer from posting the Review. Fooduction does not undertake to review each Review made by a Customer.</p>\r\n\r\n<p>(e) To the fullest extent permitted by law, Fooduction is not responsible for the content of any Reviews.</p>\r\n\r\n<p>7. <strong>Forums </strong></p>\r\n\r\n<p>(a) The Site has a forum on which Users are able to communicate.</p>\r\n\r\n<p>(b) It is a requirement of using the forum that Users limit their discussions to topics relevant to Fooduction&rsquo;s Site, App and Services.</p>\r\n\r\n<p>(c) Fooduction reserves the right to remove any posts by Users which Fooduction, at its sole discretion, deems to be inappropriate.</p>\r\n\r\n<p>(d) Users acknowledge and agree that they are not permitted to post posts which contain foul language, illegal material, defamatory comments, business advertisements, spam, religious debates, comments which incite fear, and/or any form of abuse, insults or personal attacks.</p>\r\n\r\n<p><strong>8. Collection and Payment </strong></p>\r\n\r\n<p>(a) The Customer is responsible for collecting any Food Product it purchases from the Business. Fooduction is not involved in the delivery process. If a Business chooses to use a third party delivery service provider, that arrangement is solely between the Business and the Customer and it is strictly and expressly not part of the User&rsquo;s agreement with Fooduction.</p>\r\n\r\n<p>(b) Businesses must set out their trading hours clearly on their Profile, and collection of Food Product Orders must be arranged between the Business and the Customer within those trading hours.</p>\r\n\r\n<p>(c) Payments for Businesses and Customers differ.</p>\r\n\r\n<p>(d) Customers are not required to pay any fees for their registration on our App but are subject to transaction fees for purchase of Food Products (<strong>Customer Fees</strong>).</p>\r\n\r\n<p>(e) Businesses will be required to pay a nominal fee for their registration on our App as well as an additional fee for each Listing it posts (collectively referred to as <strong>Business Fees</strong>), which will be invoiced on a weekly basis. Businesses are required to make a minimum of 2 Listings per week.</p>\r\n\r\n<p>(f) Each Business agrees to pay the relevant fees in the currency specified on the App at the time the Business registers and every time it creates a Listing. Each Customer agrees to pay the relevant fees in the currency specified on the App at the time it seeks the Services.</p>\r\n\r\n<p>(g) Goods and Services Tax (<strong>GST</strong>) will be charged where applicable.</p>\r\n\r\n<p>(h) As the Business&rsquo;s limited payment collection agent, Fooduction will collect from the Customer the Fees on behalf of the Business.</p>\r\n\r\n<p>(i) At the end of each week or fortnight, Fooduction will facilitate payment to a Business&rsquo;s nominated bank account the total Customer Fees accrued for the Food Products delivered to a Customer by that particular Business during that week or fortnight less the agreed commission payable by that Business to Fooduction for referring the Customer to that Business.</p>\r\n\r\n<p>(j) The User may pay for the Services by direct debt or credit card using PayPal or POLi. The User must not pay, or attempt to pay, for the Services through any fraudulent or unlawful means. If a User&rsquo;s payment is not able to be successfully processed then the request for a registration or a transaction may be cancelled.</p>\r\n\r\n<p>(k) Business Fees will be processed at registration.</p>\r\n\r\n<p>(l) Customer Fees will be processed at each transaction.</p>\r\n\r\n<p><strong>FOODUCTION PTY LTD MARKETPLACE TERMS AND CONDITIONS Confidential </strong>Page 5 of 13</p>\r\n\r\n<p>(m) In the absence of fraud or mistake, all payments made are final and the User shall not have the right to cancel its purchase for any re