ation of liability reflects the allocation of risk between the parties. The limitations specified in this section will survive and apply even if any limited remedy specified in these terms is found to have failed of its essential purpose. The limitations of liability provided in these terms inure to the benefit of Fooduction.</p>\r\n\r\n<p><strong>22. Indemnity </strong></p>\r\n\r\n<p>(a) Each User agrees to defend and indemnify and hold Fooduction (and Fooduction&rsquo;s parent, related bodies corporate, officers, directors, contractors, employees and agents) harmless from and against any claims, actions, suits, demands, damages, liabilities, costs or expenses (including legal costs and expenses on a full indemnity basis), including in tort, contract or negligence, arising out of or connected to the User&rsquo;s use of or access to the Services; any breach by the User of these Terms; any wilful, unlawful or negligent act or omission by the User; and any violation by the User of any applicable laws or the rights of any third party.</p>\r\n\r\n<p>(b) Fooduction reserves the right to assume the exclusive defence and control of any matter otherwise subject to indemnification by the User, in which event the User will cooperate in asserting any available defences.</p>\r\n\r\n<p>(c) This defence and indemnification obligation will survive these Terms and the User&rsquo;s use of the App, Site or Services. These Terms, and any rights and licences granted hereunder, may not be transferred or assigned by the User, but may be assigned by Fooduction without restriction.</p>\r\n\r\n<p><strong>23. General </strong></p>\r\n\r\n<p><strong>FOODUCTION PTY LTD MARKETPLACE TERMS AND CONDITIONS Confidential </strong>Page 12 of 13</p>\r\n\r\n<p><strong>(a)</strong> <strong>Accuracy: </strong>While Fooduction will endeavour to keep the information up to date and correct, Fooduction makes no representations, warranties or guarantee, express or implied, about the completeness, accuracy, reliability, suitability or availability of any information, images, products, services, or related graphics contained on the Site or App for any particular purpose. The User hereby acknowledges that such information and materials may contain mistakes, inaccuracies or errors and Fooduction expressly excludes any liability for such to the fullest extent permissible by law.</p>\r\n\r\n<p><strong>(b)</strong> <strong>Security</strong>: Fooduction has a secured business system with an &lsquo;A Grade&rsquo; SSL connection to protect all User transactions and to ensure maximum security. All credit card payments are processed by a secured third party processor with Level 1 PCI DSS compliance.</p>\r\n\r\n<p><strong>(c)</strong> <strong>Termination: </strong>Fooduction reserves the right to refuse supply of the Services required by any User, terminate any User&rsquo;s Account, terminate its contract with any User, and remove or edit content on the App at its sole discretion, without incurring any liability to the User. If Fooduction decides to terminate a User&rsquo;s Account any of the following may occur, with or without notice to the User:</p>\r\n\r\n<p>(i) The User&rsquo;s Account will be deactivated, its password will be disabled and it will not be able to access the App, Services, its Account or its User Content;</p>\r\n\r\n<p>(ii) Any pending or future Orders (in respect of a Customer or Business) will be immediately terminated;</p>\r\n\r\n<p>(iii) Fooduction may communicate to the relevant Business or Customer that the Order has been cancelled;</p>\r\n\r\n<p>(iv) Fooduction may refund the Customer in full, regardless of the cancellation and refund policy;</p>\r\n\r\n<p>(v) Fooduction may contact Customers to inform them of potential alternative Food Products available from different Businesses on the App and Services; and</p>\r\n\r\n<p>(vi) The User will not be entitled to any compensation for Orders that were cancelled as a result of a suspension, deactivation or termination of their Account.</p>\r\n\r\n<p><strong>(d)</strong> <strong>Fraudulent Activities: </strong>Each User acknowledges and agrees that, in the event Fooduction reasonably suspects that there are fraudulent activities occurring within the App and Services, Fooduction reserves the right to immediately terminate any Accounts involved in such activities, contact the relevant authorities and provide all necessary information to assist in proceedings and investigations.</p>\r\n\r\n<p><strong>(e)</strong> <strong>Force Majeure</strong>: Fooduction will not be liable for any delay or failure to perform its obligations under the Terms if such delay is due to any circumstance beyond its reasonable control.</p>\r\n\r\n<p><strong>(f)</strong> <strong>Notice: </strong>Any notice in connection with the Terms will be deemed to have been duly given when made in writing and delivered or sent by email or post to the party to whom such notice is intended to be given or to such other address or email address as may from time to time be notified in writing to the other party.</p>\r\n\r\n<p><strong>(g)</strong> <strong>Waiver: </strong>Any failure by a party to insist upon strict performance by the other of any provision in the Terms will not be taken to be a waiver of any existing or future rights in relation to the provision. No waiver by Fooduction of any of the Terms shall be effective unless Fooduction expressly states that it is a waiver and Fooduction communicates it to the User in writing.</p>\r\n\r\n<p><strong>(h)</strong> <strong>Assignment: </strong>A User must not assign any rights and obligations under the Terms whether in whole or in part without Fooduction&rsquo;s prior written consent.</p>\r\n\r\n<p><strong>(i) Severability: </strong>If any of the Terms are determined by any competent authority to be invalid, unlawful or unenforceable to any extent, such term, condition or provision will to that extent be severed from the remaining terms, conditions and provisions which will continue to be valid to the fullest extent permitted by law.</p>\r\n\r\n<p><strong>FOODUCTION PTY LTD MARKETPLACE TERMS AND CONDITIONS Confidential </strong>Page 13 of 13</p>\r\n\r\n<p><strong>(j)</strong> <strong>Jurisdiction and Applicable Law: </strong>These Terms, use of the App, the Site or the Services and any dispute arising out of any User&rsquo;s use of the App, Site or Services is subject to the laws of Western Australia, Australia, and subject to the exclusive jurisdiction of the Western Australia courts. Fooduction makes no representation that the content of the App or Site complies with the laws (including intellectual property laws) of any country outside Australia. If a User accesses the App or Site from outside Australia, it does so as its own risk and are responsible for complying with the laws in the place where he/she accesses the Site or App.</p>\r\n\r\n<p><strong>(k) Entire Agreement: </strong>Without limiting any rights under the common law, these Terms and any document expressly referred to in them represent the entire agreement between Fooduction and each User, and supersede any prior agreement, understanding or arrangement between Fooduction and each User, whether oral or in writing.</p>\r\n\r\n<p><strong>For questions and notices, please contact: </strong></p>\r\n\r\n<p>Fooduction Pty Ltd (ABN 60 615 234 725)</p>\r\n\r\n<p>Email: info@shahlegacy.com.au</p>\r\n\r\n<p><strong>Last update: </strong>30 November 2016</p>\r\n\r\n<p>LegalVision ILP Pty Ltd owns the copyright in this document and use without permission is prohibited.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-02-11 11:42:39');
