(2, 'Privacy Policy', '<p><strong>FOODUCTION PTY LTD PRIVACY POLICY </strong></p>\r\n\r\n<p>Page 1 of 3</p>\r\n\r\n<p><strong>FOODUCTION PTY LTD &ndash; PRIVACY POLICY </strong></p>\r\n\r\n<p>This Privacy Policy sets out the commitment of Fooduction Pty Ltd (ABN 60 615 234 725), its successors and assignees (referred to as <strong>we</strong>, <strong>us </strong>and <strong>our</strong>) to protecting the privacy of your personal information that we collect through this website fooduction.com.au (<strong>Site</strong>) or directly from you, being the person, organisation or entity that uses our Site (referred to as <strong>you </strong>or <strong>your</strong>).</p>\r\n\r\n<p>Please read this Privacy Policy carefully. Please contact us if you have any questions &ndash; our contact details are at the end of this Privacy Policy.</p>\r\n\r\n<p>You providing us with personal information indicates that you have had sufficient opportunity to access this Privacy Policy and that you have read and consented to it.</p>\r\n\r\n<p>If you do not wish to provide personal information to us, then you do not have to do so, however, it may affect your use of this Site or any products and services offered on it.</p>\r\n\r\n<p>1. <strong>Collection of personal information </strong></p>\r\n\r\n<p><strong>Personal information</strong>: The type of information we collect may include:</p>\r\n\r\n<ul>\r\n	<li>Name;</li>\r\n	<li>Images;</li>\r\n	<li>Contact details including email address, address and telephone number;</li>\r\n	<li>Marital status and anniversary;</li>\r\n	<li>Date of birth;</li>\r\n	<li>Demographic information such as postcode;</li>\r\n	<li>Preferences and opinions; and</li>\r\n	<li>Any other information requested on this Site or otherwise requested by us or&nbsp;provided by you.</li>\r\n</ul>\r\n\r\n<p><strong>Your use of our Site</strong>: As with most online businesses, we may log information about your access and use of our Site, including through the use of Internet cookies, your communications with our Site, the type of browser you are using, the type of operating system you are using and the domain name of your Internet service provider.</p>\r\n\r\n<p><strong>Your opinion and feedback</strong>: We may contact you to voluntarily respond to questionnaires, surveys or market research to seek your opinion and feedback. Providing this information is optional to you.</p>\r\n\r\n<p>If we receive your personal information from third parties, we will protect it as set out in this Privacy Policy.</p>\r\n\r\n<p>2.<strong>Collection and use of personal information </strong></p>\r\n\r\n<p>We collect and use the information for purposes including:</p>\r\n\r\n<ul>\r\n	<li>To contact and communicate with you;</li>\r\n	<li>For internal record keeping;</li>\r\n	<li>For market research and business development including website development;</li>\r\n	<li>For marketing including direct marketing;</li>\r\n	<li>For run competitions or offer additional benefits to you;</li>\r\n	<li>To send you promotional information about third parties that we think may be of interest to you; and</li>\r\n	<li>For data analytics purposes.&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>FOODUCTION PTY LTD PRIVACY POLICY </strong></p>\r\n\r\n<p>Page 2 of 3</p>\r\n\r\n<p><strong>3.</strong> <strong>Disclosure of personal information to third parties</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>We may disclose personal information to:</p>\r\n\r\n<ul>\r\n	<li>Credit reporting agencies and courts, tribunals and regulatory authorities where customers fail to pay for goods or services provided by us to them;</li>\r\n	<li>\r\n	<p>Courts, tribunals, regulatory authorities and law enforcement officers as required by law, in connection with any actual or prospective legal proceedings, or in order to establish, exercise or defend our legal rights;</p>\r\n	</li>\r\n	<li>\r\n	<p>Third parties, including agents or sub-contractors, who assist us in providing information, products, services or direct marketing to you. This may include parties located, or that store data, outside of Australia including in India; and</p>\r\n	</li>\r\n	<li>\r\n	<p>Third parties to collect and process data including Google Analytics. This may include parties that store data outside of Australia.&nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Where we disclose your personal information to third parties for these purposes, we will request that the third party follows this Privacy Policy regarding the handling of your personal information.</p>\r\n\r\n<p>If there is a change of control of our business or a sale or transfer of business assets, we reserve the right to transfer to the extent permissible by law our user databases, together with any personal information and non-personal information contained in those databases. This information may be disclosed to a potential purchaser. We would seek to only disclose information in good faith.</p>\r\n\r\n<p>4. <strong>Your rights and controlling your personal information </strong></p>\r\n\r\n<p><strong>Choice and consent</strong>: Providing us with your personal information is optional to you. You can choose not to provide personal information. When you provide us with your personal information, you consent to the terms of this Privacy Policy, and to us disclosing or receiving your personal information for these purposes.</p>\r\n\r\n<p><strong>Your provision of third party information: </strong>If you provide us with third party personal information then you warrant to us that you have the third party&rsquo;s consent to provide this.</p>\r\n\r\n<p><strong>Restrict</strong>: You may choose to restrict the collection or use of your personal information. If you have previously agreed to us using your personal information for direct marketing purposes, you may change your mind at any time by contacting us at the email address listed in this Privacy Policy.</p>\r\n\r\n<p><strong>Access</strong>: You may request details of personal information that we hold about you, in certain circumstances set out in the <em>Privacy Act 1988 </em>(Cth). An administrative fee may be payable for the provision of information. We may refuse to provide you with information that we hold about you, in certain circumstances set out in the Privacy Act.</p>\r\n\r\n<p><strong>Correction: </strong>If you believe that any information we hold about you is inaccurate, out of date, incomplete, irrelevant or misleading, please contact us by email. We rely in part upon customers advising us when their personal information changes. We will respond to any request within a reasonable time. We will endeavor to promptly correct any information found to be inaccurate, incomplete or out of date.</p>\r\n\r\n<p><strong>Complaints: </strong>If you believe that we have breached the Australian Privacy Principles and wish to make a complaint about that breach, please contact us by email setting out details of the breach. We will promptly investigate your complaint and respond to you in writing setting out the outcome of our investigation, what steps we propose to take to remedy the breach and any other action we will take to deal with your complaint.</p>\r\n\r\n<p><strong>Unsubscribe</strong>: To unsubscribe from our e-mail database, or opt out of communications, please contact us using the details below.</p>\r\n\r\n<p><strong>5. Storage and Security</strong></p>\r\n\r\n<p>We are committed to ensuring that the information you provide is secure. In order to prevent unauthorized access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information and protect it from misuse, interference, loss and unauthorized access, modification and disclosure. <strong>FOODUCTION PTY LTD PRIVACY POLICY </strong></p>\r\n\r\n<p>Page 3 of 3</p>\r\n\r\n<p>No information transmitted over the Internet can be guaranteed to be secure. We cannot guarantee the security of any information that you transmit to us or receive from us. The transmission and exchange of information are carried out at your own risk. Although we take measures to safeguard against unauthorized disclosures of information, we cannot assure you that personal information that we collect will not be disclosed in a manner that is inconsistent with this Privacy Policy.</p>\r\n\r\n<p><strong>6. Cookies &amp; Web Beacons</strong></p>\r\n\r\n<p>We may use cookies on this Site from time to time. Cookies are text files placed in your computer&#39;s browser to store your preferences. Cookies, by themselves, do not tell us your e-mail address or other personally identifiable information. However, once you choose to furnish the Site with personally identifiable information, this information may be linked to the data stored in the cookie.</p>\r\n\r\n<p>We may use web beacons on this Site from time to time. Web beacons or clear.gifs are small pieces of code placed on a web page to monitor the visitors&rsquo; behavior and collect data about the visitors viewing a web page. For example, web beacons can be used to count the users who visit a web page or to deliver a cookie to the browser of a visitor viewing that page.</p>\r\n\r\n<p>We may use Google Analytics to collect and process data. To find out how Google uses data when you use third party websites or applications, please see www.google.com/policies/privacy/partners/ or any other URL Google may use from time to time.</p>\r\n\r\n<p>7. <strong>Links to other websites </strong></p>\r\n\r\n<p>Our Site may contain links to other websites of interest. We do not have any control over those websites. We are not responsible for or liable for the protection and privacy of any information which you provide whilst visiting such websites, and such websites are not governed by this Privacy Policy.</p>\r\n\r\n<p><strong>8. Amendments</strong></p>\r\n\r\n<p>This Privacy Policy may be amended, including with changes, additions, and deletions, from time to time in our sole discretion. Your continued use of our Site following any amendments indicates that you accept the amendments. You should check this Privacy Policy regularly, prior to providing personal information, to ensure you are aware of any changes, and only proceed to provide personal information if you accept the new Privacy Policy.</p>\r\n\r\n<p><strong>For questions or notices, please contact our Privacy Officer at: </strong></p>\r\n\r\n<p>Fooduction Pty Ltd (ABN 60 615 234 725)</p>\r\n\r\n<p>Email: info@shahlegacy.com.au</p>\r\n\r\n<p><strong>Last update: </strong>30 November 2016</p>\r\n\r\n<p>LegalVision ILP Pty Ltd owns the copyright in this document and uses without permission is prohibited.&nbsp;</p>\r\n', '2017-02-08 13:26:55'),
